import React, { Component } from 'react'

export class PrintTodo extends Component {
  render() {
    return (
      <div>
        <ul>
          {todos.map(item => (
            item.data.map((value, index) => (  
              <li key = { index }> 
                UserId : {value.userId}<br/>
                id : {value.id}<br/>
                title : {value.title}
                completed : {value.completed}
              </li>  
            ))
          ))}
        </ul>
      </div>
    )
  }
}

export default PrintTodo


